const LoginScreen = ({ navigation }) => {
const [state, setState] = useState({
    Name:'',
  })

  return (

    <SignupForm
      buttonText="Log in"
      onSubmit={login}
      onAuthentication={() => navigation.navigate('Home')}
    >
      <br>
      </br>
      <Button 
        color='black'
        title="Create account"
        onPress={() => navigation.navigate('Signup')}
      />  

  <Text style={{marginTop:20}}>{state.Name}</Text>
    </SignupForm>
  );
};

